import React from "react";
import Container from "@mui/material/Container";
import Grid from "@mui/material/Grid";
import Typography from "@mui/material/Typography";
import Box from "@mui/material/Box";

const Footer = () => {
  return (
    <Box bgcolor="black" color="white" py={3} mt={5}>
  <Container maxWidth="80%">
    <Grid container sx={{ whiteSpace: "nowrap", flexWrap: "nowrap" }}>
      <Grid item xs={12} sm={6} sx={{ mr: 2 }}>
        {/* Apply a margin-right of 2 units to the left column */}
        <Typography className="footer_body">Left Column</Typography>
      </Grid>
      <Grid item xs={6} sm={3}>
        <Typography variant="body1">Right Column 1</Typography>
      </Grid>
      <Grid item xs={6} sm={3} sx={{ ml: 2 }}>
        {/* Apply a margin-left of 2 units to the right column 2 */}
        <Typography variant="body1">Right Column 2</Typography>
      </Grid>
    </Grid>
  </Container>
</Box>
  );
};

export default Footer;
